import { AbstractNodeFactory, DiagramEngine } from "storm-react-diagrams";
import { Node } from "../models/Node";
import * as React from "react";
import { NodeWidget } from "../widgets/NodeWidget";

export class NodeFactory extends AbstractNodeFactory<Node> {
	constructor() {
		super("table");
	}

	generateReactWidget(diagramEngine: DiagramEngine, node: Node): JSX.Element {
		return React.createElement(NodeWidget, {
			node: node,
			diagramEngine: diagramEngine
		});
	}

	getNewInstance(initialConfig?: any): Node {
		return new Node("table");
	}
}
